нд 5 м", "БУТИК ПОДАРКОВ"], "138": ["Все супер, герлянда работает", "2021-01-03T16:00:28Z", "прозрачный", "0", 0, 1, 5, "Удлинитель для гирлянд 5 м", "БУТИК ПОДАРКОВ"], "149": ["Удлинитель прислали сломанный", "2020-12-31T15:57:34Z", "прозрачный", "0", 1, 0, 1, "Удлинитель для гирлянд 5 м", "БУТИК ПОДАРКОВ"], "150": ["Купил удлинитель , чтобы провод от гирлянды можно быть протянуть по комнате до той розетки, до которой удобно. Провод целых 5 метров. Работает без нареканий!) можно использовать не только для таких гирлянд, но ещё и для обычных)", "2020-12-31T13:42:53Z", "прозрачный", "0", 3, 0, 5, "Удлинитель для гирлянд 5 м", "БУТИК ПОДАРКОВ"], "156": ["Удлиннитель рабьтает отлично!", "2020-12-30T16:44:25Z", "прозрачный", "0", 1, 0, 5, "Удлинитель для гирлянд 5 м", "БУТИК ПОДАРКОВ"], "160": ["Заказала 2 удлинителя. Один пришел нормальный, второй - испорченный. Контакт порван, гирлянда не подключается. Место стыка очень мягкое, как будто резина что ли. \nВторая работает хорошо. Цвет прозрачный, длина 5 м, более, чем достаточно. ", "2020-12-29T18:59:07Z", "прозрачный", "0", 1, 0, 3, "Удлинитель для гирлянд 5 м", "БУТИК ПОДАРКОВ"], "174": ["Пришёл в нерабочем состоянии. Перед отправкой не проверяется товар? Возврат.", "2020-12-28T19:34:40Z", "прозрачный", "0", 2, 0, 1, "Удлинитель для гирлянд 5 м", "БУТИК ПОДАРКОВ"], "200": ["Удлинитель хороший,работает. Спасибо.", "2020-12-27T09:13:25Z", "прозрачный", "0", 1, 0, 5, "Удлинитель для гирлянд 5 м", "БУТИК ПОДАРКОВ"], "218": ["Это что- то!!!! Вилка кривая...контакт из- за этого  не плотно прилегает, что совсем небезопасно....Неужеле нельзя делать качественный продукт??? Как игрушечные штекеры у вилки, да и гнезда, куда вставлять вилку от гирлянды- всё перекошенное...Не можете найти качественного производителя- не подвергайте людей опасности...", "2020-12-26T10:18:10Z", "прозрачный", "0", 1, 1, 1, "Удлинитель для гирлянд 5 м", "БУТИК ПОДАРКОВ"], "243": ["Отличный шнур, все целое и в е работает! Спасибо", "2020-12-23T16:36:25